// src/components/HomePage.js
import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/HomePage.css';

const HomePage = () => {
  return (
    <div className="home-container">
      <section className="hero">
        <h1>Explore the World with VM Trip</h1>
        <p>Your adventure starts here. Book unforgettable experiences today!</p>
        <Link to="/trips" className="hero-btn">Browse Trips</Link>
      </section>
    </div>
  );
};

export default HomePage;
